import React from 'react'
import classNames from "classnames/bind";

import { Link } from 'react-router-dom';
import style from "../Home/Home.module.scss";

export default function Header() {
  const cx = classNames.bind(style)

  return (
      <div className={cx("wrapper")}>
      {/* <Link to="/" className={cx("navbarBrand",)}>Trang Admin</Link> */}
      <ul className={cx("navbarNav")}>
        <li className={cx("navItem")}>
          <Link to="/contracts" className={cx("navLink")}>Hợp đồng</Link>
        </li>
        <li className={cx("navItem")}>
          <Link to="/orders" className={cx("navLink")}>Đơn hàng</Link>
        </li>
        <li className={cx("navItem")}>
          <Link to="/users" className={cx("navLink")}>Quản lý Người dùng</Link>
        </li>
      </ul>
      </div>
  )
}
